import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JS</li>
        <li>React</li>
      </ul>
    </div>
  )
}
export default App;
